import React, { useEffect, useState } from "react";
import axios from "axios";
const GetUser = () => {
  const [userList, setUserList] = useState([]);

  useEffect(() => {
    axios
      .get(" https://jsonplaceholder.typicode.com/posts")
      .then((response) => response.data)
      .then((res) => {
        setUserList(res);
      });
  }, []);

  return (
    <div>
      <h1>Axios Demo !!!</h1>
      <ul>
        {userList.map((user) => (
          <div>
            <center>
              <table style={{ gap: "20px", padding: "20px" }}>
                <tbody>
                  <tr>
                    {
                      <div>
                        <th>
                          <tr>
                            <td>{user.userId}</td>
                          </tr>
                        </th>
                        <th>
                          {" "}
                          <tr>
                            <td>{user.title}</td>
                          </tr>
                        </th>
                      </div>
                    }
                  </tr>
                </tbody>
              </table>
            </center>
          </div>
        ))}
      </ul>
    </div>
  );
};

export default GetUser;
